import './App.css';
import { Routes,Route, BrowserRouter } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <>
    <div className="App">
     <BrowserRouter>
     <Navbar/>
     <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='/about' element={<About/>}/>
     </Routes>
     </BrowserRouter>
    </div>
    </>
  );
}

export default App;
